import * as React from 'react';
import { View, Text,Image} from 'react-native';
import { Button } from 'react-native-web';
import { Header,Container,HeaderButtonLeft,HeaderButtonRight} from './styles';
import { Entypo } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';
import logo from '../BluebarryPancake/Vector.png';

function BluebarryPancakeScreen({navigation}) {
  return (
    <View>
      <Header>
        <HeaderButtonLeft>
          <Ionicons name="chevron-back" size={20} color={"black"} />
        </HeaderButtonLeft>
        <HeaderButtonRight>
          <Entypo name="dots-two-horizontal" size={20} color="black" />
        </HeaderButtonRight>
      </Header>
      <Container>
        <Image source={logo}/>
        <Text>Category</Text>
        <Button
          title="Go to Meal Schedule"
          onPress={() => navigation.navigate('Meal Schedule')}
        />
      </Container> 
    </View>
  );
}
export default BluebarryPancakeScreen;
